    #region Core Functions

    /// <summary>
    /// Conversor genrico de bases
    /// Converte valores para string
    /// </summary>
    /// <param name="valor">The valor.</param>
    /// <param name="genBase">The gen base.</param>
    /// <returns></returns>
    internal static string GenCvTo(Int64 valor, string genBase)
    {
      int baseSize = genBase.Length;
      string result = "";
      Int64 inteiro;
      Int64 resto;

      do
      {
        inteiro = valor / baseSize;
        resto = valor % baseSize;
        valor = inteiro;
        result += genBase[(int)resto].ToString();
      } while (inteiro != 0);

      return result;
    }

    /// <summary>
    /// Conversor genrico de bases
    /// Converte char para valor
    /// </summary>
    /// <param name="ch">The ch.</param>
    /// <param name="genBase">The gen base.</param>
    /// <returns></returns>
    internal static int GenCharFrom(char ch, string genBase)
    {
      int result = genBase.IndexOf(ch);
      return result;
    }


    /// <summary>
    /// Inverts the string.
    /// </summary>
    /// <param name="st">The st.</param>
    /// <returns></returns>
    internal static string InvertString(string st)
    {
      string result = "";
      for (int i = st.Length - 1; i >= 0; i--)
      {
        result += st[i].ToString();
      }
      return result;
    }

    /// <summary>
    /// Conversor genrico
    /// Converte string para valor
    /// </summary>
    /// <param name="st">The st.</param>
    /// <param name="genBase">The gen base.</param>
    /// <returns></returns>
    internal static Int64 GenCvFrom(string st, string genBase)
    {
      int baseSize = genBase.Length;
      Int64 result = 0;

      for (int i = 0; i < st.Length; i++)
      {
        char ch = st[i];
        int charValue = GenCharFrom(ch, genBase);
        Int64 mult = (Int64)Math.Pow(baseSize, i);
        result += charValue * mult;
      }
      return result;
    }


    /// <summary>
    /// Expansor genrico de caracteres
    /// </summary>
    /// <param name="ch">The ch.</param>
    /// <param name="genBase">The gen base.</param>
    /// <returns></returns>
    internal static string GenExpand(char ch, string genBase)
    {
      int baseSize = genBase.Length;
      int charValue = GenCharFrom(ch, genBase);
      int value = rnd.Next(baseSize);
      int complemento = GetComplement(value, charValue, baseSize);
      string result = genBase[value].ToString() + genBase[complemento].ToString();

      if (result.Length == 1)
        result = GenExpand(result[0], genBase);

      return result;
    }

    /// <summary>
    /// Gets the complement.
    /// </summary>
    /// <param name="value">The value.</param>
    /// <param name="target">The target.</param>
    /// <param name="baseSize">Size of the base.</param>
    /// <returns></returns>
    internal static int GetComplement(int value, int target, int baseSize)
    {
      value = value % baseSize;
      int result = target - value;
      if (result < 0)
        result += baseSize;

      return result;
    }

    /// <summary>
    /// Gets the char complement.
    /// </summary>
    /// <param name="value">The value.</param>
    /// <param name="target">The target.</param>
    /// <param name="genBase">The gen base.</param>
    /// <returns></returns>
    internal static char GetCharComplement(char value, char target, string genBase)
    {
      int baseSize = genBase.Length;
      int iValue = GenCharFrom(value, genBase);
      int iTarget = GenCharFrom(target, genBase);

      int complemento = GetComplement(iValue, iTarget, baseSize);
      int tex = (iValue + complemento) % baseSize;

      return genBase[complemento];
    }

    internal static char GenContract(string st, string genBase)
    {
      int baseSize = genBase.Length;
      int value = 0;
      for (int i = 0; i < st.Length; i++)
      {
        value += GenCharFrom(st[i], genBase);
      }

      value = value % baseSize;

      return genBase[value];
    }

    internal static char GenSubtract(string st, string genBase)
    {
      int baseSize = genBase.Length;
      int value = GenCharFrom(st[0], genBase) - GenCharFrom(st[1], genBase);
      if (value < 0)
        value += baseSize;

      return genBase[value];
    }

    internal static string GenExpandTo(Char ch, int lgt, string genBase)
    {
      string result = GenExpand(ch, genBase);
      while (result.Length < lgt)
      {
        result = result.Substring(0, result.Length - 1) + GenExpand(result[result.Length - 1], genBase);
      }
      return result;
    }

    internal static string CvB1ToB2(string st, string B1, string B2)
    {
      Int64 tmp = GenCvFrom(st, B1);
      string result = GenCvTo(tmp, B2);
      return result;
    }

    internal static int[] GetSequence(int seq, CryCube cube)
    {
      int baseSize = cube.sequences.Length;
      int[] result = new int[baseSize];
      string[] strSeq = cube.sequences[seq].Split(',');
      for (int i = 0; i < baseSize; i++)
      {
        result[i] = Convert.ToInt32(strSeq[i]);
      }
      return result;
    }

    internal static int[] GetSequence(char ch, CryCube cube)
    {
      int value = GenCharFrom(ch, cube.bases[0]);
      return GetSequence(value, cube);
    }

    public static CryCube GetLongCube()
    {
      return new CryCube(longBases, longSequences);
    }

    public static CryCube GetShortCube()
    {
      return new CryCube(shortBases, shortSequences);
    }

    internal static int KeyToInt32(string key, CryCube cube)
    {
      Int64 i64 = GenCvFrom(key, cube.bases[0]);
      while (i64 > Int32.MaxValue)
      {
        string s64 = Convert.ToString(i64);
        int mid = s64.Length / 2;
        string s1 = s64.Substring(0, mid);
        string s2 = s64.Substring(mid + 1);
        i64 = Convert.ToInt64(s1) + Convert.ToInt64(s2);
      }
      return (Int32)i64;
    }
